import React from "react";
import Add from "../actions/Add"
import Search from "../actions/Search";
import logoApp from "../images/favooks.png"
import plus from "../images/plus.png"
import {Link} from "react-router-dom";

export default function Nav() {

    return(
        <>
            <div className="nav-logo">
                <Link to="../" ><img className="logo" src={logoApp} alt="logo"/></Link>
                <div className="nav">
                    <Link to="/addbook">
                        <button className=" button plus"><img src="../images/plus.png" alt="dodaj nową książkę"/><Link to="./addbook"/></button>
                    </Link>
                    <Link to="/search"><input type="text" id='text' placeholder="search"/></Link>
                </div>
            </div>
        </>
    )
};
